import React from "react";
import DraftsIcon from "@mui/icons-material/Drafts";

function Header() {
  return (
    <div className="pl-4 pt-2 pb-1 flex items-center border-b-2 justify-between">
      <h2 className="text-green-700 text-[25px] font-[800]">N</h2>
      <div className="text-[21px] ml-[4px] font-[400]">메일</div>
      <div className="iconlist">
        <DraftsIcon />
      </div>
    </div>
  );
}

export default Header;
